import React from "react";

class Todo extends React.Component {
  render() {
    let { menuObj } = this.props;
    console.log(menuObj);
    console.log(typeof menu);
    if (menuObj === "home") {
      return (
        <>
          <p>Homeeeeeeeeeeeeeeeee</p>
        </>
      );
    }
    if (menuObj === "todo") {
      return (
        <>
          <p>Todoooooooooooooooooo</p>
        </>
      );
    }
  }
}
export default Todo;
